/*****************************************************                                               
*NAME                                                                                                
*  subject_petra_api                                                                              
*TYPE: PROC                                                                                          
*DATE: 29/DEC/2002                                                                                   
*FUNCTION:                                                                                           
*  Process input line which has an 'subject_petra_acc' subject.                                           
*  Input line is assumed to have been checked and                                                    
*  found to be of right format.                                                                      
*CALLING SEQUENCE:                                                                                   
*  subject_petra_api(current_line,current_line_ptr)                                               
*INPUT:                                                                                              
*  SOC_SAND_DIRECT:                                                                                           
*    CURRENT_LINE *current_line -                                                                    
*      Pointer to prompt line to process.                                                            
*    CURRENT_LINE **current_line_ptr -                                                               
*      Pointer to prompt line to be displayed after                                                  
*      this procedure finishes execution. Caller                                                     
*      points this variable to the pointer to                                                        
*      the next line to display. If called function wishes                                           
*      to set the next line to display, it replaces                                                  
*      the pointer to the next line to display.                                                      
*  SOC_SAND_INDIRECT:                                                                                         
*    None.                                                                                           
*OUTPUT:                                                                                             
*  SOC_SAND_DIRECT:                                                                                           
*    int -                                                                                           
*      If non zero then some error has occurred.                                                     
*  SOC_SAND_INDIRECT:                                                                                         
*    Processing results. See 'current_line_ptr'.                                                     
*REMARKS:                                                                                            
*  This procedure should be carried out under 'task_safe'                                            
*  state (i.e., task can not be deleted while this                                                   
*  procedure is being carried out).                                                                  
*SEE ALSO:                                                                                           
*****************************************************/                                               
int                                                                                                  
  subject_petra_acc(                                                                              
    CURRENT_LINE *current_line,                                                                      
    CURRENT_LINE **current_line_ptr                                                                  
  )                                                                                                  
{                                                                                                    
  unsigned int                                                                                       
    match_index;                                                                                     
  int                                                                                                
    ui_ret;                                                                                          
                                                                                                     
                                                                                                     
  ui_ret = FALSE ;                                                                                   
                                                                                                     
  /*                                                                                                 
   * the rest of the line is empty                                                                   
   */                                                                                                
  if (current_line->num_param_names == 0)                                                            
  {                                                                                                  
    send_string_to_screen("\n\r",FALSE) ;                                                            
    send_string_to_screen("'subject_petra_api()' function was called with no parameters.\n\r",FALSE) ;                     
    goto exit ;                                                                                      
  }                                                                                                  
  /*                                                                                                 
   * Else, there are parameters on the line (not just 'subject_petra_api').                               
   */                                                                                                
                                                                                                     
  send_array_to_screen("\n\r",2) ;                                                                   
                                                                                                     
                                                                                                     
                                                                                                     
  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_ACC_OLP_ID,1))          
  {                                                                                                  
    ui_ret = ui_petra_acc_olp(current_line);                                                              
  }                                                                                                  
  else if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_ACC_IRE_ID,1))          
  {                                                                                                  
    ui_ret = ui_petra_acc_ire(current_line);                                                              
  }                                                                                                  
  else if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_ACC_IDR_ID,1))          
  {                                                                                                  
    ui_ret = ui_petra_acc_idr(current_line);                                                              
  }                                                                                                  
  else if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_ACC_IRR_ID,1))          
  {                                                                                                  
    ui_ret = ui_petra_acc_irr(current_line);                                                              
  }                                                                                                  
  else if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_ACC_IHP_ID,1))          
  {                                                                                                  
    ui_ret = ui_petra_acc_ihp(current_line);                                                              
  }                                                                                                  
  else if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_ACC_IQM_ID,1))          
  {                                                                                                  
    ui_ret = ui_petra_acc_iqm(current_line);                                                              
  }                                                                                                  
  else if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_ACC_IPS_ID,1))          
  {                                                                                                  
    ui_ret = ui_petra_acc_ips(current_line);                                                              
  }                                                                                                  
  else if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_ACC_IPT_ID,1))          
  {                                                                                                  
    ui_ret = ui_petra_acc_ipt(current_line);                                                              
  }                                                                                                  
  else if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_ACC_DPI_ID,1))          
  {                                                                                                  
    ui_ret = ui_petra_acc_dpi(current_line);                                                              
  }                                                                                                  
  else if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_ACC_RTP_ID,1))          
  {                                                                                                  
    ui_ret = ui_petra_acc_rtp(current_line);                                                              
  }                                                                                                  
  else if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_ACC_EGQ_ID,1))          
  {                                                                                                  
    ui_ret = ui_petra_acc_egq(current_line);                                                              
  }                                                                                                  
  else if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_ACC_CFC_ID,1))          
  {                                                                                                  
    ui_ret = ui_petra_acc_cfc(current_line);                                                              
  }                                                                                                  
  else if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_ACC_SCH_ID,1))          
  {                                                                                                  
    ui_ret = ui_petra_acc_sch(current_line);                                                              
  }                                                                                                  
  else if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_ACC_MMU_ID,1))          
  {                                                                                                  
    ui_ret = ui_petra_acc_mmu(current_line);                                                              
  }                                                                                                  
  else if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_ACC_QDR_ID,1))          
  {                                                                                                  
    ui_ret = ui_petra_acc_qdr(current_line);                                                              
  }                                                                                                  
  else if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_PETRA_ACC_DUMP_ID,1))          
  {                                                                                                  
    ui_ret = ui_petra_acc_dump(current_line);                                                              
  }                                                                                                  
  else                                                                                               
  {                                                                                                  
    /*                                                                                               
     * Enter if an unknown request.                                                                  
     */                                                                                              
    send_string_to_screen(                                                                           
      "\n\r"                                                                                         
      "*** soc_petra_acc command with unknown parameters'.\n\r"                                       
      "    Syntax error/sw error...\n\r",                                                            
      TRUE)  ;                                                                                       
    ui_ret = TRUE  ;                                                                                 
    goto exit  ;                                                                                     
  }                                                                                                  
                                                                                                     
exit:                                                                                                
  return (ui_ret);                                                                                   
}                                                                                                    
                                                                                                     
#endif
